pub enum TimerError {

    /// The requested timeout exceeds the timer's `max_timeout` setting.
    TooLong,

    /// The timer has reached capacity and cannot support new timeouts.
    NoCapacity,
}

pub enum TimeoutError<T> {

    /// An error caused by the timer
    Timer(T, TimerError),

    /// The operation timed out
    TimedOut(T),
}
